    false,nt"url": null,nt"notes": "This PDF document contains bibliographic
    citations of geothermal-related information for Utah representing publications released
    through 2010. The bibliography supports the American Association of State Geologists
    initiative to build the National Geothermal Data System. A separate version (Excel
    file) is attached, which was created as a serachable index in spreadsheet format
    with links to other on-line resources. This bibliography is preceded by the compilation
    of Budding and Bugden (1986), which was later updated through 2000 by Blackett and
    Wakefield (2002). The citations listed here were extracted from Budding and Bugden
    (1986), Blackett and Wakefiled (2002), and various others.",nt"license_title":
